import React, { useState, useEffect} from 'react';/*eslint-disable*/
import '../../css/login/artilheiro.css';
import { Button, Image, Form, InputGroup, FormControl, Col, Carousel, Alert } from 'react-bootstrap';
import { apiC } from "../../conexoes/api";
import BootstrapTable from 'react-bootstrap-table-next';
import { useNavigate } from 'react-router-dom';


export default function Tabelateste() {

    var Tabela = React.createClass({
        getInitialState: function () {
            return { ordenarPor:'pontos' };
        },
    
        mudaOrdenacao: function (novaOrdenacao) {
            this.setState({ ordenarPor: novaOrdenacao });
        },
    
        render: function () {
            return (
                <table className="table">
                    <TabelaCabecalho mudaOrdenacao={this.mudaOrdenacao} />
                    <ListaTimes ordenarPor={this.state.ordenarPor} />
                </table>
            );
        }
    });
    
    var TabelaCabecalho = React.createClass({
        alteraOrdenacao: function (event) {
            var colunaSelecionada = event.target.id;
            this.props.mudaOrdenacao(colunaSelecionada);
        },
        render: function () {
            return (
                <thead>
                    <tr>
                        <th id="nome" onClick={this.alteraOrdenacao}>Time</th>
                        <th id="vitorias" onClick={this.alteraOrdenacao}>Vit√≥rias</th>
                        <th id="empates" onClick={this.alteraOrdenacao}>Empates</th>
                        <th id="derrotas" onClick={this.alteraOrdenacao}>Derrotas</th>
                        <th id="pontos" onClick={this.alteraOrdenacao}>Pontos</th>
                    </tr>
                </thead>
            );
        }
    });
    
    var ListaTimes = React.createClass({
        getInitialState: function () {
            var times = [
                { nome: 'Flamengo', vitorias: 4, empates: 0, derrotas: 0, pontos: 12 },
                { nome: 'Fortaleza', vitorias: 1, empates: 1, derrotas: 2, pontos: 4 },
                { nome: 'Figueirense', vitorias: 0, empates: 1, derrotas: 3, pontos: 1 },
            ];
    
            return { times: times };
        },
    
        comparaTimes: function (timeA, timeB) {
            var criterio = this.props.ordenarPor;
            if (!timeA.hasOwnProperty(criterio) || !timeB.hasOwnProperty(criterio)) {
                return 0;
            }
    
            if (timeA[criterio] > timeB[criterio]) {
                return -1;
            }
    
            if (timeA[criterio] < timeB[criterio]) {
                return 1;
            }
    
            return 0;
        },
    
        pegaTimesOrdenados: function () {
            var timesOrdenados = this.state.times.sort(this.comparaTimes);
    
            return timesOrdenados;
        },
    
        render: function () {
            var times = this.pegaTimesOrdenados();
            var timesHTML = times.map(function (time) {
                return (
                    <Time nome={time.nome}
                          vitorias={time.vitorias}
                          empates={time.empates}
                          derrotas={time.derrotas}
                          pontos={time.pontos} />
                );
            })
    
            return (
                <tbody>
                    { timesHTML }
                </tbody>
            );
        }
    });
    
    var Time = React.createClass({
        render: function () {
            return (
                <tr>
                    <td>{ this.props.nome }</td>
                    <td>{ this.props.vitorias }</td>
                    <td>{ this.props.empates }</td>
                    <td>{ this.props.derrotas }</td>
                    <td>{ this.props.pontos }</td>
                </tr>
            );
        }
    });
    
    ReactDOM.render(
        <Tabela/>,
        document.getElementById('tabela-brasileirao')
    );





}
